{
  // set smem data types
  __shared__ bool smem_block_flag;

  __shared__ int smem_warp_scan[32]; // for warp-level exclusive scan

  cg::thread_block cta = cg::this_thread_block();

  if (cta.thread_rank() == 0)
    smem_block_flag = false;

  cta.sync();

  const int j = threadIdx.x + blockIdx.x * blockDim.x + 3;
  const int i = (threadIdx.y + blockIdx.y * blockDim.y) * 4 + 3;

  // find keypoints
  bool isKeyPt[4] = {false, false, false, false};

  for (int t = 0; t < 4; ++t)
  {
    if (i+t < image.rows-3 &&
        j < image.cols-3)
    {
      isKeyPt[t] = isKeyPoint2(image, i+t, j, highThres, scoreMat);
    }
  }

  cta.sync();

  for (int t = 0; t < 4; ++t)
  {
    short2 loc = make_short2(j, i+t);
    int score = scoreMat(loc.y, loc.x);

    bool findKeyptFlag = (isKeyPt[t] && isMax(loc, scoreMat));

    int thread_offset = unifu::warpAggAtomicAdd(findKeyptFlag,
                                                smem_block_flag,
                                                smem_warp_scan,
                                                pKeysCount);

    bool full = (thread_offset >= maxKeypoints)

    if (findKeyptFlag && !full)
    {
      pKeypts[thread_offset].pt.x = static_cast<float>(loc.x);
      pKeypts[thread_offset].pt.y = static_cast<float>(loc.y);
      pKeypts[thread_offset].size = FEATURE_SIZE;
      pKeypts[thread_offset].angle = -1;
      pKeypts[thread_offset].response = static_cast<float>(score);
    }

    isKeyPt[t] = false;
  }

  cta.sync();

  if (smem_block_flag) return;

  // lower the threshold and try again
  for (int t = 0; t < 4; ++t)
  {
    if (i+t < image.rows-3 &&
        j < image.cols-3)
    {
      isKeyPt[t] = isKeyPoint2(image, i+t, j, lowThres, scoreMat);
    }
  }

  cta.sync();

  for (int t = 0; t < 4; ++t)
  {
    short2 loc = make_short2(j, i+t);
    int score = scoreMat(loc.y, loc.x);

    bool findKeyptFlag = (isKeyPt[t] && isMax(loc, scoreMat));

    int thread_offset = unifu::warpAggAtomicAdd(findKeyptFlag,
                                                smem_block_flag,
                                                smem_warp_scan,
                                                pKeysCount);

    bool full = (thread_offset >= maxKeypoints)

    if (findKeyptFlag && !full)
    {
      pKeypts[thread_offset].pt.x = static_cast<float>(loc.x);
      pKeypts[thread_offset].pt.y = static_cast<float>(loc.y);
      pKeypts[thread_offset].size = FEATURE_SIZE;
      pKeypts[thread_offset].angle = -1;
      pKeypts[thread_offset].response = static_cast<float>(score);
    }
  }
}

