////////////////////////////////////////////////////////////
////////////////////////////////////////////////////////////
__global__
void addBorderScaleKernel(KeyPoint* keypoints,
                          int ptsNum,
                          int minBorderX,
                          int minBorderY,
                          int octave,
                          float size)
{
  int tid = blockIdx.x * blockDim.x + threadIdx.x;

  if (tid >= ptsNum)
    return;

  keypoints[tid].pt.x += minBorderX;
  keypoints[tid].pt.y += minBorderY;
  keypoints[tid].octave = octave;
  keypoints[tid].size = size;
}

__global__
void getAngleKernel(const PtrStepSz<unsigned char> image,
                    KeyPoint* keypoints,
                    const int ptsNum,
                    const int half_patch)
{
  __shared__ int smem0[8 * 32];
  __shared__ int smem1[8 * 32];

  volatile int* srow_u = smem0 + threadIdx.y * blockDim.x;
  volatile int* srow_v = smem1 + threadIdx.y * blockDim.x;

  cv::cuda::device::plus<int> op;

  const int ptidx = blockIdx.x * blockDim.y + threadIdx.y;

  if (ptidx < ptsNum)
  {
    int m_u = 0, m_v = 0;

    const short2 loc = make_short2(keypoints[ptidx].pt.x,
                                   keypoints[ptidx].pt.y);

    // Scan the central line (x+u, y)
    for (int u = threadIdx.x - half_patch;
         u <= half_patch;
         u += blockDim.x)
    {
      m_u += u * image(loc.y, loc.x + u);
    }

    reduce<32>(srow_u, m_u, threadIdx.x, op);

    // Scan other line pairs (x+u, y+v) & (x+u, y-v)
    for (int v = 1; v <= half_patch; ++v)
    {
      int v_sum = 0;
      int u_sum = 0;

      const int d = c_u_max[v];

      for (int u = threadIdx.x - d;
           u <= d;
           u += blockDim.x)
      {
        int val_plus  = image(loc.y + v, loc.x + u);
        int val_minus = image(loc.y - v, loc.x + u);

        v_sum += (val_plus - val_minus);
        u_sum += u * (val_plus + val_minus);
      }

      reduce<32>(smem_tuple(srow_u, srow_v),
                 thrust::tie(u_sum, v_sum),
                 threadIdx.x,
                 thrust::make_tuple(op, op));
      
      m_u += u_sum;
      m_v += v * v_sum;
    }

    if (threadIdx.x == 0)
    {
      float kp_dir = atan2f((float)m_v, (float)m_u);
      kp_dir += (kp_dir < 0) * (2.0f * CV_PI_F);
      kp_dir *= 180.0f / CV_PI_F;

      keypoints[ptidx].angle = kp_dir;
    }
  }
}


