GpuFast::GpuFast(int hThres, int lThres, int maxKeypoints)
    : mHighThres(hThres), mLowThres(lThres), mMaxKeypoints(maxKeypoints)
{
  checkCudaErrors(cudaStreamCreate(&mCudaStream));
  mCvStream = StreamAccessor::wrapStream(mCudaStream);

  mCountHost = 0;
  checkCudaErrors(cudaMalloc(&mpCountDevice, sizeof(int)));

  checkCudaErrors(cudaMalloc(&mpKeyptsDevice, sizeof(KeyPoint) * mMaxKeypoints))
}

GpuFast::~GpuFast()
{
  mCvStream.~Stream();
  checkCudaErrors(cudaFree(mpCountDevice));
  checkCudaErrors(cudaFree(mpKeyptsDevice));
  checkCudaErrors(cudaStreamDestroy(mCudaStream));
}

void GpuFast::detect(InputArray img,
                     std::vector<KeyPoint> &keypoints)
{
  this->detectAsync(img);

  this->joinDetectAsync(keypoints);
}

void GpuFast::loadUMaxData(const int* umax, int count)
{
  checkCudaErrors( cudaMemcpyToSymbol(c_u_max, umax, count*sizeof(int)) );
}

void GpuFast::detectAsync(InputArray img)
{
  const GpuMat image = img.getGpuMat();

  if (scoreMat.empty())
  {
    scoreMat = GpuMat(image.size(), CV_32SC1)
  }
  else if (image.size() != scoreMat.size())
  {
    scoreMat.release();
    scoreMat = GpuMat(image.size(), CV_32SC1)
  }

  scoreMat.setTo(Scalar::all(0), mCvStream);

  checkCudaErrors(cudaMemsetAsync(mpCountDevice, 0, sizeof(int), mCudaStream));

  dim3 dimBlock(32, 8);
  dim3 dimGrid(divUp(image.cols, dimBlock.x), divUp(image.rows, dimBlock.y * 4));

  // Use 7x7 kernel to detect FAST and Harris feature (the reason of the +3/-3 and *4/+4 tricks)
  detectKeypointsKernel<<<dimGrid, dimBlock, 0, mCudaStream>>>(
      mMaxKeypoints,
      mHighThres,
      mLowThres,
      image,
      scoreMat,
      mpCountDevice,
      mpKeyptsDevice
  );
  checkCudaErrors(cudaGetLastError());

  checkCudaErrors(cudaMemcpyAsync(&mCountHost,
                                  mpCountDevice,
                                  sizeof(int),
                                  cudaMemcpyDeviceToHost,
                                  mCudaStream));
}

void GpuFast::joinDetectAsync(std::vector<cv::KeyPoint> &keypoints)
{
  checkCudaErrors(cudaStreamSynchronize(mCudaStream));

  mCountHost = std::min(mCountHost, mMaxKeypoints);

  keypoints.resize(mCountHost);

  checkCudaErrors(cudaMemcpyAsync(keypoints.data(), mpKeyptsDevice,
                                  sizeof(KeyPoint)*mCountHost,
                                  cudaMemcpyDeviceToHost,
                                  mCudaStream));

  checkCudaErrors(cudaStreamSynchronize(mCudaStream));
}

void GpuFast::getAngle(cv::InputArray img,
                       std::vector<cv::KeyPoint> &keypoints,
                       int minBorderX, int minBorderY, int halfPatch,
                       int octave, float size)
{
  this->getAngleAsync(img,
                      keypoints,
                      minBorderX, minBorderY, halfPatch,
                      octave, size);
  
  this->joinGetAngleAsync(keypoints);
}

void GpuFast::getAngleAsync(cv::InputArray img,
                            std::vector<cv::KeyPoint> &keypoints,
                            int minBorderX, int minBorderY, int halfPatch,
                            int octave,
                            float size)
{
  if (keypoints.size() == 0)
  {
    return;
  }

  const GpuMat image = img.getGpuMat();

  checkCudaErrors(cudaMemcpyAsync(mpKeyptsDevice, keypoints.data(), sizeof(KeyPoint)*keypoints.size(), cudaMemcpyHostToDevice, mCudaStream));

  // Add border and scale information
  {
    dim3 block(256);
    dim3 grid(divUp(keypoints.size(), block.x));

    addBorderScaleKernel<<<grid, block, 0, mCudaStream>>>(
        mpKeyptsDevice,
        keypoints.size(),
        minBorderX,
        minBorderY,
        octave,
        size
    );
    checkCudaErrors(cudaGetLastError());
  }

  // Compute IC angle for fast corners
  {
    dim3 block(32, 8);
    dim3 grid(divUp(keypoints.size(), block.y));

    getAngleKernel<<<grid, block, 0, mCudaStream>>>(image,
                                                    mpKeyptsDevice,
                                                    keypoints.size(),
                                                    halfPatch);
    checkCudaErrors(cudaGetLastError());
  }
}

void GpuFast::joinGetAngleAsync(std::vector<cv::KeyPoint> &keypoints)
{
  checkCudaErrors(cudaMemcpyAsync(keypoints.data(), mpKeyptsDevice, sizeof(KeyPoint)*keypoints.size(), cudaMemcpyDeviceToHost, mCudaStream));

  checkCudaErrors(cudaStreamSynchronize(mCudaStream));
}

